pragma solidity >=0.4.21 <0.6.0;

import '../node_modules/openzeppelin-solidity/contracts/token/ERC721/ERC721Full.sol';
import '../node_modules/openzeppelin-solidity/contracts/token/ERC721/ERC721Full.sol';
import '../contracts/Registration.sol';
import '../contracts/Access.sol';


contract CreateDiamond is ERC721,ERC721Full, df_Registration,df_Access{
constructor() ERC721Full("DiamondFactory", "DF") public {}

  struct Diamond {
    string gemName;
    string gemCountry;
    string gemcolor;
    string gemclarity;
    string gemcut;
    uint256 gemcarat;
    address owner;
    string status;
  }
  using SafeMath for uint256;

  Diamond[] public diamonds;

  string constant STATUS_PENDING = "Pending";
  string constant STATUS_VERIFIED = "Verified";

///Events.
 event eventcreateDiamond(address _address, uint256 _diamondID);
 event eventtransferOwnership(address _from, address _to, uint256 _diamondID);
 event TransactionHistory(
      uint256 _diamondID,
      address _seller,
      address _buyer,
      uint256 _Price,
      uint256 timestamp
    );

 mapping(uint256 => bool) internal diamondExists;  //Check if Diamond Exists
 mapping(address => uint256) internal balances;      //Check this address has how many Diamonds
 mapping(uint256 => address) internal diamondIdToOwner; //Map Diamond ID to owner.
 mapping(uint256 => Diamond) internal diamondMetadata;

 function createDiamond(
    string memory _gemName,
    string memory _gemCountry,
    string memory _gemcolor,
    string memory _gemclarity,
    string memory _gemcut,
    uint256 _gemcarat)
    public
    onlyManufacturer
    whenNotPaused{
    Diamond memory _diamond = Diamond(_gemName,_gemCountry,_gemcolor,_gemclarity,_gemcut,_gemcarat,msg.sender,STATUS_PENDING);
    uint _diamondID = diamonds.push(_diamond);
    _mint(msg.sender, _diamondID);
    diamondExists[_diamondID] = true;
    diamondMetadata[_diamondID] = _diamond;
    emit eventcreateDiamond(msg.sender, _diamondID);
  }

function VerifyDiamond(uint256 _diamondID)
    public
    onlyAdminOrCEO
    whenNotPaused{
      require(diamondExists[_diamondID],"Diamond Not Created");
      Diamond storage diamond = diamondMetadata[_diamondID];
      diamond.status = STATUS_VERIFIED;
    }

function _isDiamondVerified(uint256 _diamondID) public view returns (bool) {
      require(diamondExists[_diamondID],"Diamond not created");
      return(keccak256(abi.encodePacked(diamondMetadata[_diamondID].status)) == keccak256(abi.encodePacked(STATUS_VERIFIED)));
    }

function _isManufacturer(address _address) internal view returns (bool) {
      require(users[_address]._registered,"User Not registered");
      return(keccak256(abi.encodePacked(users[_address]._userType)) == keccak256(abi.encodePacked("Manufacturer")));
    }

function _isRetailer(address _address) internal view returns (bool) {
      require(users[_address]._registered,"User Not registered");
      return(keccak256(abi.encodePacked(users[_address]._userType)) == keccak256(abi.encodePacked("Retailer")));
    }

function _BuyfromManufacturer(
      uint256 _diamondID,
      address _seller,
      address _buyer,
      uint256 _Price
      )
      public
      onlyRetailer
      whenNotPaused{
      require(_isDiamondVerified(_diamondID),"Diamond is not verified");
      require(_isManufacturer(_seller),"Seller is not manufacturer");
      Diamond storage diamond = diamondMetadata[_diamondID];
      diamond.owner = _buyer;
      _transferFrom(_seller, _buyer, _diamondID);
      emit TransactionHistory(_diamondID,_seller,_buyer,_Price,now);
    }

 function getDiamond(uint _diamondID) public view returns(
  string memory,
  string memory,
  string memory,
  string memory,
  string memory,
  uint256){
    require(diamondExists[_diamondID],"Diamond not created");
    return(
    diamonds[_diamondID].gemName,
    diamonds[_diamondID].gemCountry,
    diamonds[_diamondID].gemcolor,
    diamonds[_diamondID].gemclarity,
    diamonds[_diamondID].gemcut,
    diamonds[_diamondID].gemcarat);
    }

  function ownerofToken(uint256 _diamondID) public view returns (address) {
      require(diamondExists[_diamondID],"Diamond is not created");
      ownerOf(_diamondID);
    }
}
